import React from 'react';
import jsPDF from 'jspdf';
import { Download, FileText, AlertTriangle, CheckCircle } from 'lucide-react';

// üè• LOGO CNS OFICIAL EN BASE64 (mismo que el m√©dico)
const CNS_LOGO_BASE64 = "data:image/png;base64,";
class PatientPDFGenerator {
  /**
   * üè• GENERADOR PDF PARA PACIENTES - FICHA DE TRIAJE OPTIMIZADA Y PULCRA
   */
  static async generatePatientTriagePDF(patientData) {
    try {
      console.log('üìÑ Generando Ficha de Triaje OPTIMIZADA para paciente:', patientData.patientName);

      const pdf = new jsPDF({
        orientation: 'portrait',
        unit: 'mm',
        format: 'a4'
      });

      const pageWidth = pdf.internal.pageSize.getWidth();
      const pageHeight = pdf.internal.pageSize.getHeight();
      const margin = 15;

      let currentY = margin;

      // 1. Header CNS institucional (optimizado)
      currentY = this.addCNSHeaderOptimized(pdf, pageWidth, currentY);
      
      // 2. Informaci√≥n del paciente (mejorada)
      currentY = this.addPatientInfoOptimized(pdf, patientData, pageWidth, currentY, margin);
      
      // 3. CLASIFICACI√ìN MANCHESTER (pulcra y destacada)
      currentY = this.addUrgencyClassificationOptimized(pdf, patientData, pageWidth, currentY, margin);
      
      // 4. S√≠ntomas registrados (organizada)
      currentY = this.addSymptomsOptimized(pdf, patientData, pageWidth, currentY, margin);
      
      // 5. Signos vitales (si disponibles, ordenados)
      if (this.hasVitalSigns(patientData)) {
        currentY = this.addVitalSignsOptimized(pdf, patientData, pageWidth, currentY, margin);
      }
      
      // 6. Instrucciones para el paciente (claras y organizadas)
      currentY = this.addPatientInstructionsOptimized(pdf, patientData, pageWidth, currentY, margin);
      
      // 7. Footer optimizado - calculado din√°micamente
      this.addOptimizedFooter(pdf, pageWidth, pageHeight, margin, currentY);

      // Generar nombre de archivo
      const timestamp = new Date().toISOString().slice(0, 10);
      const patientSafe = (patientData.patientName || 'Paciente').replace(/[^a-zA-Z0-9]/g, '_');
      const fileName = `CNS_Triaje_${patientSafe}_${timestamp}.pdf`;
      
      pdf.save(fileName);
      
      console.log('‚úÖ Ficha de Triaje OPTIMIZADA generada:', fileName);
      return { success: true, fileName };
      
    } catch (error) {
      console.error('‚ùå Error generando ficha de triaje optimizada:', error);
      throw new Error(`Error al generar ficha de triaje: ${error.message}`);
    }
  }

  // ==========================================
  // üé® COMPONENTES OPTIMIZADOS DEL PDF
  // ==========================================

  static addCNSHeaderOptimized(pdf, pageWidth, startY) {
    // Header con altura perfecta de 32mm
    const headerHeight = 32;
    pdf.setFillColor(0, 75, 68);
    pdf.rect(0, 0, pageWidth, headerHeight, 'F');

    // Logo CNS posicionado perfectamente
    try {
      pdf.addImage(CNS_LOGO_BASE64, 'PNG', 15, 6, 16, 16);
    } catch (error) {
      // Fallback logo con mejor posicionamiento
      pdf.setFillColor(255, 255, 255);
      pdf.circle(23, 14, 8, 'F');
      pdf.setFillColor(0, 75, 68);
      pdf.circle(23, 14, 6, 'F');
      pdf.setTextColor(255, 255, 255);
      pdf.setFontSize(6);
      pdf.setFont('helvetica', 'bold');
      pdf.text('CNS', 20.5, 15.5);
    }

    // T√≠tulos con mejor espaciado
    pdf.setTextColor(255, 255, 255);
    pdf.setFontSize(18);
    pdf.setFont('helvetica', 'bold');
    pdf.text('FICHA DE TRIAJE M√âDICO', 37, 11);
    
    pdf.setFontSize(10);
    pdf.setFont('helvetica', 'normal');
    pdf.text('CAJA NACIONAL DE SALUD - COCHABAMBA', 37, 18);
    pdf.text('Documento para el Paciente', 37, 24);

    // Fecha y hora perfectamente alineadas
    pdf.setFontSize(9);
    pdf.setFont('helvetica', 'bold');
    const fechaActual = new Date().toLocaleDateString('es-ES');
    const horaActual = new Date().toLocaleTimeString('es-ES', {
      hour: '2-digit', minute: '2-digit'
    });
    
    pdf.text(`Fecha: ${fechaActual}`, pageWidth - 50, 12);
    pdf.text(`Hora: ${horaActual}`, pageWidth - 50, 20);

    return headerHeight + 6; // 38mm total
  }

  static addPatientInfoOptimized(pdf, patientData, pageWidth, startY, margin) {
    let currentY = startY;

    // T√≠tulo de secci√≥n con mejor estilo
    pdf.setTextColor(52, 73, 94);
    pdf.setFontSize(12);
    pdf.setFont('helvetica', 'bold');
    pdf.text('DATOS DEL PACIENTE', margin, currentY);
    currentY += 8;

    // Caja de informaci√≥n con altura optimizada
    const infoBoxHeight = 22;
    pdf.setFillColor(248, 249, 250);
    pdf.setDrawColor(189, 195, 199);
    pdf.setLineWidth(0.5);
    pdf.rect(margin, currentY, pageWidth - 2 * margin, infoBoxHeight, 'FD');

    // Informaci√≥n organizada en grid perfecto
    pdf.setTextColor(0, 0, 0);
    pdf.setFontSize(10);
    const leftMargin = margin + 8;
    const rightMargin = pageWidth - 70;
    
    // Fila 1: Nombre y C.I.
    pdf.setFont('helvetica', 'bold');
    pdf.text('NOMBRE:', leftMargin, currentY + 8);
    pdf.setFont('helvetica', 'normal');
    const patientName = patientData.patientName || 'No especificado';
    pdf.text(patientName, leftMargin + 28, currentY + 8);

    pdf.setFont('helvetica', 'bold');
    pdf.text('C.I.:', rightMargin, currentY + 8);
    pdf.setFont('helvetica', 'normal');
    pdf.text(String(patientData.patientCI || 'No registrado'), rightMargin + 15, currentY + 8);

    // Fila 2: Fecha y Edad (si disponible)
    pdf.setFont('helvetica', 'bold');
    pdf.text('FECHA:', leftMargin, currentY + 16);
    pdf.setFont('helvetica', 'normal');
    const fechaConsulta = new Date().toLocaleDateString('es-ES');
    pdf.text(fechaConsulta, leftMargin + 28, currentY + 16);

    if (patientData.edad) {
      pdf.setFont('helvetica', 'bold');
      pdf.text('EDAD:', rightMargin, currentY + 16);
      pdf.setFont('helvetica', 'normal');
      pdf.text(`${patientData.edad} a√±os`, rightMargin + 15, currentY + 16);
    }

    return currentY + infoBoxHeight + 10; // Mejor espaciado
  }

  static addUrgencyClassificationOptimized(pdf, patientData, pageWidth, startY, margin) {
    let currentY = startY;

    // T√≠tulo destacado con l√≠nea decorativa
    pdf.setTextColor(231, 76, 60);
    pdf.setFontSize(13);
    pdf.setFont('helvetica', 'bold');
    pdf.text('CLASIFICACI√ìN DE URGENCIA', margin, currentY);
    
    // L√≠nea decorativa bajo el t√≠tulo
    pdf.setDrawColor(231, 76, 60);
    pdf.setLineWidth(1);
    pdf.line(margin, currentY + 2, margin + 80, currentY + 2);
    currentY += 10;

    const classification = patientData.classification || {};
    const urgencyLevel = classification.level || 5;
    const urgencyData = this.getUrgencyData(urgencyLevel);
    
    // Caja principal con altura optimizada
    const classificationBoxHeight = 38;
    pdf.setFillColor(urgencyData.color.r, urgencyData.color.g, urgencyData.color.b);
    pdf.rect(margin, currentY, pageWidth - 2 * margin, classificationBoxHeight, 'F');

    // Sombra sutil para dar profundidad
    pdf.setFillColor(0, 0, 0, 0.1);
    pdf.rect(margin + 1, currentY + 1, pageWidth - 2 * margin, classificationBoxHeight, 'F');
    pdf.setFillColor(urgencyData.color.r, urgencyData.color.g, urgencyData.color.b);
    pdf.rect(margin, currentY, pageWidth - 2 * margin, classificationBoxHeight, 'F');

    // Textos principales perfectamente centrados
    pdf.setTextColor(255, 255, 255);
    pdf.setFontSize(26);
    pdf.setFont('helvetica', 'bold');
    pdf.text(`NIVEL ${urgencyLevel}`, margin + 12, currentY + 18);
    
    pdf.setFontSize(16);
    pdf.text(urgencyData.label, margin + 12, currentY + 30);

    // Panel lateral derecho organizado
    const rightPanelX = pageWidth - 95;
    const rightPanelWidth = 85;
    
    pdf.setFontSize(11);
    pdf.setFont('helvetica', 'bold');
    pdf.text('ESPECIALIDAD:', rightPanelX, currentY + 10);
    
    // Manejo inteligente de especialidades largas
    const specialty = this.formatSpecialty(classification.specialty || 'Medicina General');
    pdf.setFontSize(11);
    pdf.setFont('helvetica', 'bold');
    
    // Usar splitTextToSize para dividir texto largo en m√∫ltiples l√≠neas
    const specialtyLines = pdf.splitTextToSize(specialty, rightPanelWidth - 5);
    
    // Renderizar especialidad en m√∫ltiples l√≠neas si es necesario
    let specialtyY = currentY + 17;
    specialtyLines.forEach((line, index) => {
      pdf.text(line, rightPanelX, specialtyY + (index * 5));
    });
    
    // Ajustar posici√≥n del tiempo m√°ximo seg√∫n cu√°ntas l√≠neas ocupe la especialidad
    const timeY = specialtyY + (specialtyLines.length * 5) + 3;
    pdf.setFontSize(9);
    pdf.setFont('helvetica', 'normal');
    pdf.text(`Tiempo m√°ximo:`, rightPanelX, timeY);
    pdf.setFont('helvetica', 'bold');
    pdf.text(urgencyData.waitTime, rightPanelX, timeY + 5);

    currentY += classificationBoxHeight + 8;

    // Mensaje de alerta para casos cr√≠ticos (mejorado)
    if (urgencyLevel <= 2) {
      const alertHeight = 14;
      pdf.setFillColor(255, 235, 235);
      pdf.setDrawColor(231, 76, 60);
      pdf.setLineWidth(1);
      pdf.rect(margin, currentY, pageWidth - 2 * margin, alertHeight, 'FD');
      
      // Icono de alerta simulado
      pdf.setFillColor(231, 76, 60);
      pdf.circle(margin + 6, currentY + 7, 3, 'F');
      pdf.setTextColor(255, 255, 255);
      pdf.setFontSize(8);
      pdf.setFont('helvetica', 'bold');
      pdf.text('!', margin + 5.2, currentY + 8.5);
      
      pdf.setTextColor(231, 76, 60);
      pdf.setFontSize(11);
      pdf.setFont('helvetica', 'bold');
      pdf.text('ATENCI√ìN PRIORITARIA - Dir√≠jase inmediatamente a recepci√≥n m√©dica', margin + 12, currentY + 8.5);
      currentY += alertHeight + 8;
    }

    return currentY;
  }

  static addSymptomsOptimized(pdf, patientData, pageWidth, startY, margin) {
    let currentY = startY;

    // T√≠tulo de secci√≥n
    pdf.setTextColor(0, 75, 68);
    pdf.setFontSize(12);
    pdf.setFont('helvetica', 'bold');
    pdf.text('S√çNTOMAS REGISTRADOS', margin, currentY);
    currentY += 8;

    // Procesar s√≠ntomas
    const symptoms = patientData.symptoms || [];
    let symptomText = '';
    
    if (Array.isArray(symptoms) && symptoms.length > 0) {
      symptomText = symptoms.join(', ');
    } else if (typeof symptoms === 'string' && symptoms.trim()) {
      symptomText = symptoms;
    } else {
      symptomText = 'No se registraron s√≠ntomas espec√≠ficos';
    }

    // Caja de s√≠ntomas con altura din√°mica optimizada
    const lines = pdf.splitTextToSize(symptomText, pageWidth - 2 * margin - 16);
    const symptomBoxHeight = Math.max(18, lines.length * 5 + 10);
    
    pdf.setFillColor(240, 248, 255);
    pdf.setDrawColor(0, 75, 68);
    pdf.setLineWidth(1);
    pdf.rect(margin, currentY, pageWidth - 2 * margin, symptomBoxHeight, 'FD');

    // Icono de s√≠ntomas simulado
    pdf.setFillColor(0, 75, 68);
    pdf.circle(margin + 6, currentY + 8, 2.5, 'F');
    pdf.setTextColor(255, 255, 255);
    pdf.setFontSize(6);
    pdf.setFont('helvetica', 'bold');
    pdf.text('+', margin + 5, currentY + 9);

    pdf.setTextColor(0, 0, 0);
    pdf.setFontSize(10);
    pdf.setFont('helvetica', 'normal');
    pdf.text(lines, margin + 12, currentY + 8);

    currentY += symptomBoxHeight + 8;

    // Notas adicionales (si existen) con mejor formato
    if (patientData.notes && patientData.notes.trim()) {
      pdf.setTextColor(108, 117, 125);
      pdf.setFontSize(10);
      pdf.setFont('helvetica', 'bold');
      pdf.text('DETALLES ADICIONALES:', margin, currentY);
      currentY += 6;
      
      const notesLines = pdf.splitTextToSize(patientData.notes.trim(), pageWidth - 2 * margin - 12);
      const notesHeight = Math.max(15, notesLines.length * 4.5 + 8);
      
      pdf.setFillColor(250, 250, 250);
      pdf.setDrawColor(189, 195, 199);
      pdf.setLineWidth(0.5);
      pdf.rect(margin, currentY, pageWidth - 2 * margin, notesHeight, 'FD');
      
      pdf.setTextColor(0, 0, 0);
      pdf.setFontSize(9);
      pdf.setFont('helvetica', 'normal');
      pdf.text(notesLines, margin + 6, currentY + 6);
      
      currentY += notesHeight + 8;
    }

    return currentY;
  }

  static addVitalSignsOptimized(pdf, patientData, pageWidth, startY, margin) {
    let currentY = startY;

    // T√≠tulo de secci√≥n
    pdf.setTextColor(0, 75, 68);
    pdf.setFontSize(11);
    pdf.setFont('helvetica', 'bold');
    pdf.text('SIGNOS VITALES REGISTRADOS', margin, currentY);
    currentY += 7;

    // Caja de signos vitales con grid organizado
    const vitalsBoxHeight = 18;
    pdf.setFillColor(249, 249, 249);
    pdf.setDrawColor(189, 195, 199);
    pdf.setLineWidth(0.5);
    pdf.rect(margin, currentY, pageWidth - 2 * margin, vitalsBoxHeight, 'FD');

    pdf.setTextColor(0, 0, 0);
    pdf.setFontSize(9);
    const leftMargin = margin + 8;
    const centerX = pageWidth / 2;
    const rightMargin = pageWidth - 60;

    let vitalsShown = false;
    let currentX = leftMargin;

    // Temperatura (izquierda)
    if (patientData.temperature) {
      const temp = parseFloat(patientData.temperature);
      pdf.setFont('helvetica', 'bold');
      pdf.text('TEMP:', currentX, currentY + 7);
      pdf.setFont('helvetica', 'normal');
      
      if (temp > 37.5) {
        pdf.setTextColor(231, 76, 60);
        pdf.text(`${patientData.temperature}¬∞C`, currentX, currentY + 13);
      } else {
        pdf.setTextColor(39, 174, 96);
        pdf.text(`${patientData.temperature}¬∞C`, currentX, currentY + 13);
      }
      pdf.setTextColor(0, 0, 0);
      vitalsShown = true;
      currentX = centerX - 15;
    }

    // Presi√≥n Arterial (centro)
    if (patientData.presionArterial && patientData.presionArterial !== '/') {
      pdf.setFont('helvetica', 'bold');
      pdf.text('P.A.:', currentX, currentY + 7);
      pdf.setFont('helvetica', 'normal');
      pdf.text(patientData.presionArterial, currentX, currentY + 13);
      vitalsShown = true;
      currentX = rightMargin;
    }

    // Frecuencia Card√≠aca (derecha)
    if (patientData.frecuenciaCardiaca) {
      pdf.setFont('helvetica', 'bold');
      pdf.text('F.C.:', currentX, currentY + 7);
      pdf.setFont('helvetica', 'normal');
      pdf.text(`${patientData.frecuenciaCardiaca}`, currentX, currentY + 13);
      vitalsShown = true;
    }

    return vitalsShown ? currentY + vitalsBoxHeight + 8 : startY;
  }

  static addPatientInstructionsOptimized(pdf, patientData, pageWidth, startY, margin) {
    let currentY = startY;

    // T√≠tulo con icono
    pdf.setTextColor(52, 73, 94);
    pdf.setFontSize(12);
    pdf.setFont('helvetica', 'bold');
    pdf.text('INSTRUCCIONES PARA EL PACIENTE', margin, currentY);
    currentY += 8;

    // Caja de instrucciones con mejor altura
    const instructionBoxHeight = 35;
    pdf.setFillColor(255, 248, 220);
    pdf.setDrawColor(255, 193, 7);
    pdf.setLineWidth(1.5);
    pdf.rect(margin, currentY, pageWidth - 2 * margin, instructionBoxHeight, 'FD');

    pdf.setTextColor(0, 0, 0);
    pdf.setFontSize(9);

    // Instrucciones organizadas con numeraci√≥n clara
    const instructions = [
      '1. Presente esta ficha en recepci√≥n m√©dica',
      `2. Mencione que tiene clasificaci√≥n Manchester Nivel ${patientData.classification?.level || 'N/A'}`,
      '3. Informe sobre todos los s√≠ntomas descritos',
      '4. Conserve este documento para futuras consultas'
    ];

    const classification = patientData.classification || {};
    if (classification.level <= 2) {
      instructions.splice(1, 0, '‚ö†Ô∏è  SOLICITE ATENCI√ìN PRIORITARIA INMEDIATA');
    }

    instructions.forEach((instruction, index) => {
      const yPos = currentY + 6 + (index * 6);
      if (instruction.includes('PRIORITARIA')) {
        pdf.setTextColor(231, 76, 60);
        pdf.setFont('helvetica', 'bold');
      } else {
        pdf.setTextColor(0, 0, 0);
        pdf.setFont('helvetica', 'normal');
      }
      pdf.text(instruction, margin + 8, yPos);
    });

    return currentY + instructionBoxHeight + 8;
  }

  static addOptimizedFooter(pdf, pageWidth, pageHeight, margin, contentEndY) {
    // Footer optimizado con separaci√≥n m√≠nima pero elegante
    let footerY = contentEndY + 6;

    // L√≠nea separadora elegante
    pdf.setDrawColor(0, 75, 68);
    pdf.setLineWidth(0.8);
    pdf.line(margin, footerY, pageWidth - margin, footerY);
    footerY += 4;

    // Footer principal
    pdf.setTextColor(52, 73, 94);
    pdf.setFontSize(8);
    pdf.setFont('helvetica', 'bold');
    pdf.text('FICHA DE TRIAJE M√âDICO - DOCUMENTO DEL PACIENTE', margin, footerY);
    
    pdf.setFont('helvetica', 'normal');
    pdf.setFontSize(7);
    pdf.text('Caja Nacional de Salud - Cochabamba | Presente este documento al personal m√©dico', margin, footerY + 5);
    
    // Timestamp alineado a la derecha
    const timestamp = new Date().toLocaleString('es-ES');
    pdf.text(`Generado: ${timestamp}`, pageWidth - 55, footerY + 5);

    // Nota legal peque√±a
    pdf.setTextColor(149, 165, 166);
    pdf.setFontSize(6);
    pdf.text('* Documento v√°lido para atenci√≥n m√©dica. Conservar hasta finalizar consulta.', margin, footerY + 10);
  }

  // ==========================================
  // üõ†Ô∏è UTILIDADES (Mantenidas)
  // ==========================================

  static hasVitalSigns(patientData) {
    return !!(patientData.temperature || 
              patientData.presionArterial || 
              patientData.frecuenciaCardiaca || 
              patientData.edad);
  }

  static getUrgencyData(level) {
    const urgencyLevels = {
      1: { label: 'EMERGENCIA VITAL', color: { r: 231, g: 76, b: 60 }, waitTime: 'INMEDIATO' },
      2: { label: 'URGENCIA ALTA', color: { r: 230, g: 126, b: 34 }, waitTime: '10 minutos' },
      3: { label: 'URGENCIA MODERADA', color: { r: 241, g: 196, b: 15 }, waitTime: '60 minutos' },
      4: { label: 'URGENCIA MENOR', color: { r: 39, g: 174, b: 96 }, waitTime: '120 minutos' },
      5: { label: 'NO URGENTE', color: { r: 52, g: 152, b: 219 }, waitTime: '240 minutos' }
    };
    return urgencyLevels[level] || urgencyLevels[5];
  }

  static formatSpecialty(specialty) {
    if (!specialty) return 'MEDICINA GENERAL';
    
    const specialtyMap = {
      'CARDIOLOG√çA': 'CARDIOLOG√çA', 'CARDIOLOGIA': 'CARDIOLOG√çA',
      'NEUMOLOG√çA': 'NEUMOLOG√çA', 'PNEUMOLOG√çA': 'NEUMOLOG√çA',
      'DERMATOLOG√çA': 'DERMATOLOG√çA', 'DERMATOLOGIA': 'DERMATOLOG√çA',
      'CIRUG√çA': 'CIRUG√çA', 'CIRUGIA': 'CIRUG√çA',
      'NEUROLOG√çA': 'NEUROLOG√çA', 'NEUROLOGIA': 'NEUROLOG√çA',
      'MEDICINA GENERAL': 'MEDICINA GENERAL',
      'URGENCIAS': 'URGENCIAS', 'URGENCIA': 'URGENCIAS'
    };
    
    return specialtyMap[specialty.toUpperCase()] || specialty.toUpperCase();
  }
}

// ==========================================
// üîò COMPONENTE DEL BOT√ìN OPTIMIZADO
// ==========================================

const PDFGeneratorPatient = ({ patientData, disabled = false, className = "" }) => {
  const [isGenerating, setIsGenerating] = React.useState(false);

  const handleDownloadPDF = async () => {
    if (!patientData || isGenerating) return;
    
    // üîç DEBUGGING OPTIMIZADO
    console.log('=== DEBUG PDF PACIENTE OPTIMIZADO V2 ===');
    console.log('üîç patientData completo:', JSON.stringify(patientData, null, 2));
    console.log('üîç patientData.patientName:', patientData.patientName);
    console.log('üîç patientData.symptoms:', patientData.symptoms);
    console.log('üîç patientData.classification:', patientData.classification);
    console.log('=========================================');
    
    try {
      setIsGenerating(true);
      console.log('üìÑ Generando ficha de triaje OPTIMIZADA V2...');
      await PatientPDFGenerator.generatePatientTriagePDF(patientData);
      console.log('‚úÖ Ficha de triaje OPTIMIZADA V2 generada exitosamente');
    } catch (error) {
      console.error('‚ùå Error:', error);
      alert(`Error al generar ficha: ${error.message}`);
    } finally {
      setIsGenerating(false);
    }
  };

  return (
    <button
      onClick={handleDownloadPDF}
      disabled={disabled || isGenerating || !patientData}
      className={`flex items-center justify-center gap-2 px-4 py-3 bg-blue-600 hover:bg-blue-700 disabled:bg-gray-400 text-white rounded-xl font-medium transition-all duration-300 shadow-lg hover:shadow-xl transform hover:scale-105 ${className}`}
    >
      {isGenerating ? (
        <>
          <div className="w-4 h-4 border-2 border-white/30 border-t-white rounded-full animate-spin"></div>
          <span>Generando ficha...</span>
        </>
      ) : (
        <>
          <Download className="w-5 h-5" />
          <span>Descargar mi Ficha de Triaje</span>
        </>
      )}
    </button>
  );
};

export default PDFGeneratorPatient;